import React from 'react'

const Project = ({project}) => {
  return (
    <div className="project">
      <h2>{project.title}</h2>
      <p>{project.description}</p>
      <a href={project.githubUrl}>
        <img className="github-logo" src="/images/github.png" alt="github icon"/>
      </a>
    </div>
  )
}

export default Project
